import React from 'react';
import './exchange-row.css'

export const ExchangeRow = ({ exchangeKey, exchangeValue }) => {
    return (
        <tr>
            <td className="Exchange">
                {`${exchangeKey} => ${exchangeValue.toFixed(10)}`}
            </td>
        </tr>
    );
}
